import styled from 'styled-components';
export const A = styled.a`
display:flex;
align-items:center;
justify-content:center;
/* padding-left:15px; */
border:2px solid navy;
width:30%;
color:#ffffff;
text-decoration:none;
background-color:#006778;
`;
